/// Represents the value of a command.
#[derive(Debug, PartialEq, Clone)]
pub enum CommandValue {
    /// An integer value.
    Int(i32),
    /// A float value.
    Float(f32),
    /// A string value.
    String(&'static str),
    /// A blob of data.
    Data(&'static [u8]),
}

impl fmt::Display for CommandValue {
    fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result {
        match self {
            CommandValue::Int(i) => write!(f, "{}", i),
            CommandValue::Float(fl) => write!(f, "{}", fl),
            CommandValue::String(s) => write!(f, "{}", s),
            CommandValue::Data(d) => write!(f, "{:?}", d),
        }
    }
}

/// Represents the format of a command.
#[derive(Debug, PartialEq, Clone)]
pub enum Format {
    /// A command type.
    Type(CommandType),
    /// A string format.
    String(String),
}

/// Represents a single OSC command.
pub struct Command {
    /// The OSC command path.
    pub command: &'static str,
    /// The format of the command.
    pub format: Format,
    /// The flags for the command.
    pub flags: i32,
    /// The value of the command.
    pub value: CommandValue,
    /// An optional node associated with the command.
    pub node: Option<&'static [&'static str]>,
}

