#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_xconfig_length() {
        assert_eq!(XCONFIG.len(), 335);
    }

    #[test]
    fn test_xmain_length() {
        assert_eq!(XMAIN.len(), 182);
    }

    #[test]
    fn test_xconfig_commands() {
        assert_eq!(XCONFIG[2].command, "/config/chlink/1-2");
        assert_eq!(XCONFIG[2].format, Format::Type(CommandType::E32));
        assert_eq!(XCONFIG[2].value, CommandValue::Int(0));
    }

    #[test]
    fn test_xmain_commands() {
        assert_eq!(XMAIN[3].command, "/main/st/config/name");
        assert_eq!(XMAIN[3].format, Format::Type(CommandType::S32));
        assert_eq!(XMAIN[3].value, CommandValue::String(""));
    }
}
